export default function Navbar() {
    return (
        <div>
           <header className="bg-blue">
             <nav>
              <ul>
                <li>Home</li>
                <li>Sign In</li>
                <li>SIgn Up</li>
              </ul>
             </nav>
           </header>
        </div>
    );
}
